description:
Shrugged 

English | CBR | 10 Issues

Genre: Fantasy

Written by Frank Mastromauro and Michael Turner

Art by Micah Gunnell

Collects Shrugged: Beginnings, plus #0-8!

Every day we're faced with choices. Left or Right? Stop or go? Love or hate? Yes or no? With each decision affecting our life, our fate. But what if those choices affected more than that, like the fate of the universe? What if they already do? What would you choose? From Michael Turner, the creative mind that brought you Fathom and Soulfire, comes the next wondrous step in comic book entertainment! For every right, there is a wrong. For every action, there is a reaction. For every up, there is a down. And for every decision Theo makes, there is someone making the decisions for him - and all of us! Welcome to Perspecta, and the reasons behind your wildest thoughts and darkest desires. If you thought you knew anything about our world, think again!

